insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">本日のランチは<br>港区最強のコストパフォーマンス(ぼく調べ)を誇る天丼<br>「天丼 金子屋」<br>にて蓋の閉まらない天丼を<br><br>温泉卵の天ぷらを割り、タレの染みたご飯と混ぜて食べるのが、月に一回しあわせのルーティン<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/FBqFht4geQ">pic.twitter.com/FBqFht4geQ</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/848395738702684160">2017年4月2日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',848395738702684160);
