insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">Urth caffe にてアースボバをテイクアウト<br><br>この特大タピオカの大ファンですが、相変わらず店内は激混み、アールグレイはソールドアウト<br><br>天気も良かったし、まあ良しとします<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/HkPEOanR9z">pic.twitter.com/HkPEOanR9z</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/853529921968197632">2017年4月16日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',853529921968197632);
insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">今夜のデザートは<br><br>「近江屋洋菓子店」<br>フルーツポンチ<br><br>お手土産で頂戴して以来、大ファンで神田にお蕎麦を食べに行くたびに寄って帰る<br><br>ぎっしりと詰め込まれたたくさんのフルーツ。<br>見応え、食べ応え満点、インパクト抜群。<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/xbBF9IMbyq">pic.twitter.com/xbBF9IMbyq</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/847819272181006336">2017年3月31日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',847819272181006336);
insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">ちなみにロールケーキといえば一度でいいから頂きたいのが日本最強の呼び声高い<br><br>沼津 冨久屋 <br>「イタリアンロール」  <br><br>しかしお取り寄せ不可、、現地でしか購入できないとのこと、、<br><br>さわやかのハンバーグといい静岡のグルメ鎖国は反則ですよ。<a href="https://twitter.com/hashtag/%E7%BE%A8%E3%81%BE%E3%81%97%E3%81%8F%E3%81%AA%E3%81%84%E3%82%88?src=hash">#羨ましくないよ</a> <a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/1cWpmEnaUZ">pic.twitter.com/1cWpmEnaUZ</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/844551529377939457">2017年3月22日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',844551529377939457);
insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">アンリシャルパンティエでチョコロールケーキを購入したら<br><br>レジのおばさまに<br><br>「きよログ掲載してくださいねー」<br><br>と言われました、、。笑<br><br>、、なんて日だ<br><br>1700円ほどとリーズナブルですが、生地もふわふわでチョコクリームも濃厚で美味です<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/9SoEa64eji">pic.twitter.com/9SoEa64eji</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/844548753801437185">2017年3月22日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',844548753801437185);
insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">最強の3時のおやつ (ぼく調べ)<br><br>白金高輪<br>「メゾンダーニ」のフィナンシェ<br><br>売り切れていたので焼き立てを予約して再訪<br><br>15時に合わせて購入<br><br>重厚なバター感、厚み、焼き目の香ばしさ<br><br>食べ終わったら仕入れるようにまた買いに行く、ぼく、、。<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/Jh698iHqUh">pic.twitter.com/Jh698iHqUh</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/843350677136986112">2017年3月19日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',843350677136986112);
insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">今夜は牛タン<br><br>六本木交差点程近く、深夜でもカジュアルに牛タンがいただける<br>「祇園亭」へ<br><br>ぼくはいつも<br>極(きわみ)上たん定食<br>サイドディッシュの一口メンチカツもおいしい<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/SrKiNrkesB">pic.twitter.com/SrKiNrkesB</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/841294243213668352">2017年3月13日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',841294243213668352);
