insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">お気に入りの六本木一丁目<br>「さんて寛」<br>にてお好み焼きランチ<br><br>必ずオーダーしているイベリコ豚ポテトチーズは相変わらず美味しいし、<br><br>冬季限定の牡蠣たっぷりの <br>「かき豚」にknockoutされました、、<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/OBOHPmaeYt">pic.twitter.com/OBOHPmaeYt</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/838221967761121280">2017年3月5日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',838221967761121280);
insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">今夜は親友とのディナー<br><br>神戸の地元で絶大な人気を誇ったビストロ「大とし」が<br><br>東京赤坂へと挑戦の場を広げたとのことで<br><br>旬の食材を大切にした&quot;日本の家庭的&quot;なフレンチ<br>神戸ポークのグリルと〆の蕎麦が美味しかったです<br><br>毎月通える優しい味付け<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/wdpfJxWbNt">pic.twitter.com/wdpfJxWbNt</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/833283144971227137">2017年2月19日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',833283144971227137);
