insert into taglog(tag,tweet,tweetId) values ('きよログ', '<blockquote class="twitter-tweet" data-lang="ja"><p lang="ja" dir="ltr">今夜の夜食は<br>中目黒「はし田や」 <br>にて<br><br>せせり、ぼんじり、ソリレス、つくねを串で頂いて<br>卵焼きは”お父さん味”<br><br>〆は安定の親子丼<br> <br>今年も花見の季節に席を抑えたい<a href="https://twitter.com/hashtag/%E3%81%8D%E3%82%88%E3%83%AD%E3%82%B0?src=hash">#きよログ</a> <a href="https://t.co/IYcwCIykjz">pic.twitter.com/IYcwCIykjz</a></p>&mdash; Kiyoto (@KiyotoDrives) <a href="https://twitter.com/KiyotoDrives/status/826783068350406656">2017年2月1日</a></blockquote><script async src="//platform.twitter.com/widgets.js" charset="utf-8"></script>',826783068350406656);
